    return (
      <div id="menu-container">
      {
        this.props.filtered.length > 0 ?

        <List
        openProfile={this.props.openProfile}
        filtered={this.props.filtered}
        />
        :
        <div>
        poop
        </div>
      }
      </div>
    );
  }

}

export default Menu;
